var update_url_parameter=function(key,value){var base_url=[location.protocol,'//',location.host,location.pathname].join('')
var url_query_string=document.location.search
var new_param=key+'='+value
var params='?'+new_param
var update_regex=''
var remove_regex=''
if(url_query_string){update_regex=new RegExp('([\?&])'+key+'[^&]*')
remove_regex=new RegExp('([\?&])'+key+'=[^&;]+[&;]?')
if(typeof value=='undefined'||value==null||value==''){params=url_query_string.replace(remove_regex,"$1")
params=params.replace(/[&;]$/,'')}else if(url_query_string.match(update_regex)!==null){params=url_query_string.replace(update_regex,"$1"+new_param)}else{params=url_query_string+'&'+new_param}}
window.history.replaceState({},'',base_url+params)}
